import React from 'react';

import classes from './styles.module.css';

type Props = {
  type: string;
  value?: string;
  country?: string;
  countryCode?: string;
  disabled: boolean;
  placeholder: string;
  onChange: (value: string) => void;
};

export const Input = ({
  type,
  value = '',
  country,
  countryCode,
  onChange,
  placeholder,
}) => (
  <input
    className={classes.input}
    value={value}
    onChange={onChange}
    placeholder={placeholder}
  />
);
